import './index.css';
import { BiHomeAlt2, BiUser, BiInfoCircle, BiLogOut } from "react-icons/bi";
import { FiFeather } from "react-icons/fi";


function App() {
  return (

    <div className='flex'>
      <Navbar />

      <div className='w-full bg-slate-100 m-10 rounded-xl'>
        <table className='shadow-lg w-5/6 text-center border-collapse mx-auto mt-40'>
          <tr>
            <th className='border bg-indigo-200'>Job Position</th>
            <th className='border bg-indigo-200'>Company</th>
            <th className='border bg-indigo-200'>Salary</th>
            <th className='border bg-indigo-200'>Location</th>
            <th className='border bg-indigo-200'>Date Added</th>
          </tr>
          <tr>
            <td className='border'>a</td>
            <td className='border'>b</td>
            <td className='border'>c</td>
            <td className='border'>d</td>
            <td className='border'>e</td>
          </tr>
        </table>
      </div>
    </div>


  );
}

export default App;
